<!doctype html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <meta http-equiv="X-UA-Compatible" content="ie=edge" />
    <title>Rollup Visualizer</title>
    <style>
      :root {
        --font-family:
          -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto,
          'Helvetica Neue', Arial, 'Noto Sans', sans-serif, 'Apple Color Emoji',
          'Segoe UI Emoji', 'Segoe UI Symbol', 'Noto Color Emoji';
        --background-color: #2b2d42;
        --text-color: #edf2f4;
      }
      html {
        box-sizing: border-box;
      }
      *,
      *::before,
      *::after {
        box-sizing: inherit;
      }
      html {
        font-family: var(--font-family);
        color: var(--text-color);
        background-color: var(--background-color);
      }
      body {
        padding: 0;
        margin: 0;
      }
      html,
      body {
        width: 100%;
        height: 100%;
        overflow: hidden;
      }
      body {
        display: flex;
        flex-direction: column;
      }
      svg {
        width: 100%;
        height: 100%;
        max-height: 100vh;
        vertical-align: middle;
      }
      main {
        flex-grow: 1;
        height: 100vh;
        padding: 20px;
      }
      .tooltip {
        position: absolute;
        z-index: 1070;
        padding: 5px;
        font-size: 0.875rem;
        color: var(--text-color);
        background-color: var(--background-color);
        border: 2px solid;
        border-radius: 5px;
      }
      .tooltip-hidden {
        visibility: hidden;
        opacity: 0;
      }
      .sidebar {
        position: fixed;
        top: 0;
        right: 0;
        left: 0;
        display: flex;
        flex-direction: row;
        align-items: center;
        height: 20px;
        margin: 0 50px;
        font-size: 0.7rem;
      }
      .size-selectors {
        display: flex;
        flex-direction: row;
        align-items: center;
      }
      .size-selector {
        display: flex;
        flex-direction: row;
        align-items: center;
        justify-content: center;
        margin-right: 1rem;
      }
      .size-selector input {
        margin: 0 0.3rem 0 0;
      }
      .filters {
        display: flex;
        flex: 1;
        flex-direction: row;
        align-items: center;
      }
      .module-filters {
        display: flex;
        flex-grow: 1;
      }
      .module-filter {
        display: flex;
        flex: 1;
        flex-direction: row;
        align-items: center;
        justify-content: center;
      }
      .module-filter input {
        flex: 1;
        height: 1rem;
        padding: 0.01rem;
        margin-left: 0.3rem;
        font-size: 0.7rem;
      }
      .module-filter + .module-filter {
        margin-left: 0.5rem;
      }
      .node {
        cursor: pointer;
      }
    </style>
